import React, {Component} from "react";
import { ApiurlUsers } from "../services/apirest";
import axios from "axios";
import Header from "../template/Header";




class Ingresar extends Component{

 

    state = {
        form:{
                "number": "",
                "validator": "",
                "name": "",
                "birthdate": "",
                "email": "",
                "code": "",
                "namerole": "",
                "last_name": "",
                "second_last_name": ""
                                    
        },
        error:false,
        errorMsg:""
    }


    manejadorChange = async e => {
      await this.setState({
          form:{
              ...this.state.form,
              [e.target.name]: e.target.value
          }
      })
   
}



manejadorSubmit = e => {
  e.preventDefault();
}




patch = () => {
  let UserEmail = this.props.match.params.id;
  let url = ApiurlUsers +  UserEmail; 
  axios.patch(url,this.state.form)
  .then( response =>{
    console.log(response)
  })
}

delete  = () =>{
  let userId = this.props.match.params.id;
  let url = ApiurlUsers +  userId; 
  let datos = {
    "userId" : userId
  }
 
   axios.delete(url,{headers:datos})
   .then (response =>{
      this.props.history.push("/dashboard");
   })
}




    componentDidMount(){


        let UserEmail = this.props.match.params.id;  
        let url = ApiurlUsers + UserEmail; 
        axios.get(url)
        .then( response => {
           this.setState({
                form:{
                    number: response.data.user.identification_document.number,
                    validator:  response.data.user.identification_document.validator,
                    name:  response.data.user.name,
                    birthdate:  response.data.user.birthdate,
                    email: response.data.user.contact.email,
                    code:  response.data.user.role.code,
                    namerole:  response.data.user.role.name,
                    last_name:  response.data.user.last_name,
                    second_last_name: response.data.user.second_last_name

                }
                
           })
          
         });
         
    }


    render(){

      const form = this.state.form

        return(
               
            <React.Fragment>

            <Header/>

            <div className="container">
                    <h3>Ingresar Usuario </h3>
            </div>

            <div className="container">
              <br/>
              <form className="form horizontal" onSubmit={this.manejadorSubmit}>
              

              <br/>
              <input type="submit" value="Guardar" className="btn btn-success" />
                <a className="btn btn-dark" href="/dashboard" >Salir</a>

              </form>
            </div>

           

            </React.Fragment>
        
               
        );
    }

}


export default Ingresar;
